    //------------------------------------------------------

    window.plugin.emojiChat.data.isSafari = function(){
        var is_safari = (navigator.userAgent.indexOf('Safari') != -1 && navigator.userAgent.indexOf('Chrome') == -1 && navigator.userAgent.indexOf('Android') == -1 && navigator.userAgent.indexOf('PhantomJS') == -1);
        return is_safari;
    }
    window.plugin.emojiChat.data.isApple = function(){
        var is_apple = (navigator.platform.indexOf('Mac') != -1);
        return is_apple;
    }
    window.plugin.emojiChat.data.toUnicode = function(r){
        for(var t='',n=0; n<r.length; n++){
            t += '\\u'+('000'+r[n].charCodeAt(0).toString(16)).substr(-4);
        }
        return t;
    }
    window.plugin.emojiChat.data.initArrEmoji = function(){
        var emojiObj = window.plugin.emojiChat.obj.emojiList;

        var regx_arr = [];
        for(var k in emojiObj){
            var emj_unicode = window.plugin.emojiChat.data.toUnicode(k);
            regx_arr.push(emj_unicode);
        }
        var regx = new RegExp('(' + regx_arr.join('|') + ')', 'g');

        window.plugin.emojiChat.obj.regx = regx;;
        window.plugin.emojiChat.obj.regx_arr = regx_arr;;
    }

    window.plugin.emojiChat.getHtml.btnEmojiList = function(){
        var emoji = '<span class="emj emj1425"></span>';
//        var emoji = '☺️';
        return '<span class="emoji btnBox" onclick="window.plugin.emojiChat.action.openEmojiBox();" title="Emoji Keyboard">'+emoji+'</span>';
    }
    window.plugin.emojiChat.getHtml.boxEmojiList = function(){
        return '<div class="emoji emojiBox"></div>';
    }
    window.plugin.emojiChat.getHtml.wrapEmoji = function(s){
        var emojiObj = window.plugin.emojiChat.obj.emojiList;
        var regx = window.plugin.emojiChat.obj.regx;

        var html = s.replace(regx, function(a, b){
            var rawEmoji = (0 == 0)? b : '';
            return '<span class="emj emj'+emojiObj[b]+'">'+rawEmoji+'</span>';
        });

        return html;
    }
    window.plugin.emojiChat.getHtml.emojiList = function(){
        var catEmj = window.plugin.emojiChat.obj.emojiCat;
        var html = '';
        var tab = '';
        var nav = '';

        var c = 0;
        for(cat in catEmj){
            var e = catEmj[cat];
            tab += '<div class="tab" data-emojiTab="'+c+'">'+e[1]+'</div>';
            nav += '<li title="'+cat+'" data-emojiTab="'+c+'" onclick="window.plugin.emojiChat.ui.emojiOpenTab('+c+');return false;">'+e[0]+'</li>';
            c++;
        }

        html += '<div class="emojiList">'+tab+'</div>';
        html += '<ul class="catList">'+nav+'</ul>';
        return html;
    }

